import React, { useState } from 'react';
import { uploadAudio, startMicRecordingWithSilence } from './audioUtils';
import './App.css';

const App = () => {
  const [theme, setTheme] = useState('light');
  const [transcript, setTranscript] = useState('');
  const [chatInput, setChatInput] = useState('');
  const [chatHistory, setChatHistory] = useState([]);
  const [sessionId] = useState(() => Date.now().toString());
  const [isRecording, setIsRecording] = useState(false);

  const toggleTheme = () => setTheme(prev => (prev === 'dark' ? 'light' : 'dark'));

  const handleAudioUpload = async (e) => {
    const file = e.target.files[0];
    const result = await uploadAudio(file);
    if (result?.transcript) setTranscript(result.transcript);
  };

  const sendToLLM = async (prompt) => {
    const userMsg = { sender: 'user', text: prompt, time: new Date().toLocaleTimeString() };
    setChatHistory(prev => [...prev, userMsg]);

    const response = await fetch('http://localhost:8000/chat', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ prompt, session_id: sessionId }),
    });

    const data = await response.json();
    const botMsg = { sender: 'bot', text: data.response, time: new Date().toLocaleTimeString() };
    setChatHistory(prev => [...prev, botMsg]);
  };

  const handleMicUpload = async () => {
    setIsRecording(true);
    await startMicRecordingWithSilence(async (text) => {
      setIsRecording(false);
      if (text) {
        setTranscript(text);
        await sendToLLM(text);
      }
    });
  };

  const handleSend = async () => {
    if (!chatInput.trim()) return;
    await sendToLLM(chatInput);
    setChatInput('');
  };

  const exportDoc = async (type) => {
    const res = await fetch(`http://localhost:8000/export/${type}`, { method: 'POST' });
    const blob = await res.blob();
    const a = document.createElement('a');
    a.href = window.URL.createObjectURL(blob);
    a.download = `chat_transcript.${type}`;
    a.click();
  };

  return (
    <div className={`app ${theme}`}>
      <div className="sidebar">
        <h2>Call Summarizer</h2>
        <input type="file" accept="audio/*" onChange={handleAudioUpload} />
        <button onClick={handleMicUpload}>{isRecording ? 'Recording...' : 'üéôÔ∏è Mic Record'}</button>
        <div className="export-buttons">
          <button onClick={() => exportDoc('pdf')}>üìÑ Export PDF</button>
          <button onClick={() => exportDoc('word')}>üìù Export Word</button>
        </div>
        <button onClick={toggleTheme}>üåì Toggle Theme</button>
      </div>

      <div className="main-content">
        <div className="chat-box">
          <div className="chat-history">
            {chatHistory.map((msg, i) => (
              <div key={i} className={`chat-msg ${msg.sender}`}>
                <span className="timestamp">{msg.time}</span>
                <p>{msg.text}</p>
              </div>
            ))}
          </div>
          <div className="chat-input-area">
            <input
              type="text"
              value={chatInput}
              onChange={e => setChatInput(e.target.value)}
              placeholder="Ask something..."
            />
            <button onClick={handleSend}>Send</button>
          </div>
        </div>

        <div className="transcript-panel">
          <h3>Transcript Preview</h3>
          <div className="transcript-text">{transcript}</div>
        </div>
      </div>
    </div>
  );
};

export default App;
